const MealsList = (props) => {
    return (
        <div className="meals-list">
            <h2>{props.title}</h2>
            <ul>
                <li>{props.prepTime}</li>
                <li>{props.season}</li>
                <li>{props.gluten}</li>
            </ul>

        </div>
    );
}

export default MealsList;
